import React, { useEffect, useRef } from "react";
import * as d3 from "d3";

const HierarchicalGraph = ({ jsonData }) => {
  const graphRef = useRef(null);

  useEffect(() => {
    if (!jsonData || Object.keys(jsonData).length === 0) return;

    const subspaces = Object.keys(jsonData);
    subspaces.sort((a, b) => a.length - b.length);

    const pointsData = subspaces.map((key) => ({
      key,
      points: jsonData[key],
      dimensions: key.length,
      subspaceId: key,
    }));

    const svg = d3.select(graphRef.current);
    const width = 800;
    const height = 800;
    const margin = 20;

    svg.selectAll("*").remove();
    const maxRadius = Math.min(width, height) / 2 - margin;
    const g = svg
      .attr("width", width)
      .attr("height", height)
      .append("g")
      .attr("transform", `translate(${width / 2}, ${height / 2})`);

    // Tooltip container
    const tooltip = d3
      .select("body")
      .append("div")
      .attr("class", "tooltip")
      .style("position", "absolute")
      .style("visibility", "hidden")
      .style("background-color", "rgba(0, 0, 0, 0.7)")
      .style("color", "white")
      .style("padding", "5px")
      .style("border-radius", "4px")
      .style("font-size", "12px");

    // Group points by Point_ID
    const pointsById = new Map();
    pointsData.forEach((subspace, index) => {
      subspace.points.forEach((point) => {
        if (!pointsById.has(point.Point_ID)) {
          pointsById.set(point.Point_ID, []);
        }
        pointsById.get(point.Point_ID).push({ ...point, subspaceIndex: index });
      });
    });

    // Draw connections between points with the same Point_ID
    pointsById.forEach((points) => {
      if (points.length > 1) {
        for (let i = 0; i < points.length - 1; i++) {
          const point1 = points[i];
          const point2 = points[i + 1];

          const x1 = getPointX(point1);
          const y1 = getPointY(point1);
          const x2 = getPointX(point2);
          const y2 = getPointY(point2);

          g.append("line")
            .attr("x1", x1)
            .attr("y1", y1)
            .attr("x2", x2)
            .attr("y2", y2)
            .attr("stroke", "black")
            .attr("stroke-width", 1)
            .attr("stroke-dasharray", "2,2"); // Optional: Add dashed lines for better visibility
        }
      }
    });

    // Helper functions to calculate point positions
    const getPointX = (point) => {
      const subspaceIndex = point.subspaceIndex;
      const innerRadius = (subspaceIndex / subspaces.length) * maxRadius;
      const outerRadius = ((subspaceIndex + 1) / subspaces.length) * maxRadius;
      const randomRadius =
        innerRadius + Math.random() * (outerRadius - innerRadius);

      const bitVector = Object.entries(point)
        .filter(([key]) => key !== "Point_ID")
        .map(([key, coord]) => (coord >= 0 ? 1 : 0))
        .join("");

      const sectors = 2 ** (subspaceIndex + 1);
      const bitVectorIndex = parseInt(bitVector, 2);
      const angleStart = (2 * Math.PI * bitVectorIndex) / sectors;
      const angleEnd = (2 * Math.PI * (bitVectorIndex + 1)) / sectors;
      const randomAngle = angleStart + Math.random() * (angleEnd - angleStart);

      return randomRadius * Math.cos(randomAngle);
    };

    const getPointY = (point) => {
      const subspaceIndex = point.subspaceIndex;
      const innerRadius = (subspaceIndex / subspaces.length) * maxRadius;
      const outerRadius = ((subspaceIndex + 1) / subspaces.length) * maxRadius;
      const randomRadius =
        innerRadius + Math.random() * (outerRadius - innerRadius);

      const bitVector = Object.entries(point)
        .filter(([key]) => key !== "Point_ID")
        .map(([key, coord]) => (coord >= 0 ? 1 : 0))
        .join("");

      const sectors = 2 ** (subspaceIndex + 1);
      const bitVectorIndex = parseInt(bitVector, 2);
      const angleStart = (2 * Math.PI * bitVectorIndex) / sectors;
      const angleEnd = (2 * Math.PI * (bitVectorIndex + 1)) / sectors;
      const randomAngle = angleStart + Math.random() * (angleEnd - angleStart);

      return randomRadius * Math.sin(randomAngle);
    };

    // Draw subspaces and points
    pointsData.forEach((subspace, index) => {
      const innerRadius = (index / subspaces.length) * maxRadius;
      const outerRadius = ((index + 1) / subspaces.length) * maxRadius;
      const sectors = 2 ** (index + 1); // Number of sectors based on subspace dimensions
      const colorScale = d3
        .scaleOrdinal()
        .range(["#FFD700", "#FF69B4", "#33B5E5"]);
      const subspaceColor = colorScale((index + 1) % colorScale.range().length);

      // Draw the outer circle representing the subspace
      g.append("circle")
        .attr("r", outerRadius)
        .attr("stroke", "black")
        .attr("fill", subspaceColor)
        .attr("fill-opacity", 0.2)
        .attr("stroke-width", 2)
        .style("pointer-events", "none"); // Ensure circles do not block hover

      // Draw the radial lines dividing the sectors
      for (let i = 0; i < sectors; i++) {
        const angle = (2 * Math.PI * i) / sectors;
        const x1 = outerRadius * Math.cos(angle);
        const y1 = outerRadius * Math.sin(angle);
        g.append("line")
          .attr("x1", 0)
          .attr("y1", 0)
          .attr("x2", x1)
          .attr("y2", y1)
          .attr("stroke", "black")
          .attr("stroke-width", 1)
          .style("pointer-events", "none"); // Ensure radial lines do not block hover
      }

      // Place points inside the subspace with bit vectors
      subspace.points.forEach((point) => {
        const x = getPointX({ ...point, subspaceIndex: index });
        const y = getPointY({ ...point, subspaceIndex: index });

        // Create a circle for each point and make sure they are on top
        const pointElement = g
          .append("circle")
          .attr("cx", x)
          .attr("cy", y)
          .attr("r", 4)
          .attr("fill", "black")
          .attr("stroke", "white")
          .attr("stroke-width", 0.5)
          .style("pointer-events", "visible") // Make points interactive
          .on("mouseover", (event) => {
            const bitVector = Object.entries(point)
              .filter(([key]) => key !== "Point_ID")
              .map(([key, coord]) => (coord >= 0 ? 1 : 0))
              .join("");

            tooltip.style("visibility", "visible").html(`
                <strong>Bit Vector:</strong> ${bitVector}<br>
                <strong>Coordinates:</strong> (${Object.entries(point)
                  .filter(([key]) => key !== "Point_ID")
                  .map(([key, coord]) => `${key}: ${coord}`)
                  .join(", ")})
              `);
          })
          .on("mousemove", (event) => {
            tooltip
              .style("top", event.pageY + 10 + "px")
              .style("left", event.pageX + 10 + "px");
          })
          .on("mouseout", () => {
            tooltip.style("visibility", "hidden");
          });
      });
    });
  }, [jsonData]);

  return (
    <>
      <svg ref={graphRef} style={{ width: "800px", height: "800px" }}></svg>
    </>
  );
};

export default HierarchicalGraph;
